    [],nt"num_tags": 9,nt"name": "progress-report-1993-regulation-of-mule-deer-population-growth-by-fertility-control-labora",nt"isopen":
    false,nt"url": null,nt"notes": "We developed analytical models to describe
    dynamics of the Rocky Mountain Arsenal mule population. Our objectives were: 1)
    To estimate carrying capacity of the Arsenal using existing data on population composition
    and performance. 2) To estimate the proportion of the population that must be infertile
    to maintain the population at approximately half of carrying capacity. 3) To estimate
    the delivery rate and the number of animals that must be treated annually to maintain
    the population at half of carrying capacity. 4) To compare the effort required to
    stabilize the population using lifetime duration contraceptives with the effort
    required to stabilize the population using culling. Here, we summarize our progress
    toward these objectives.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
